import axios from "axios"

const setShow = (dates) => {
    return {
        type : SET_SHOW,
        dates
    }
}

const viewShow = (movieId) => {
    return(dispatch) => {
        axios.get(`http://localhost:3040/shows/${movieId}`)
        .then((data) => {
            console.log("shows sheduled : ",data)
            // dispatch(setShow(data))
        })
        .catch((err) => console.log(err))
    }
}

export {
    viewShow
}
